// client/src/SQLiteDataTable.js
import React, { useState } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

const Search = () => {
  const [data, setData] = useState([]);
  const [searchValue, setSearchValue] = useState('');
  const [selectedCategory, setSelectedCategory] = useState(null);

  const handleRadioChange = (category) => {
    setSelectedCategory(category);
  };

  const handleSearchInputChange = (e) => {
    setSearchValue(e.target.value);
  };

  const handleSearch = () => {

    if (!selectedCategory) {
      alert('You have to pick the category of the search');
      return;
    }

    fetch(`http://localhost:5000/search?query=${searchValue}&category=${selectedCategory}`)
      .then(response => response.json())
      .then(data => {
        if (data.length === 0) {
          setData(['No result']);
        } else {
          setData(data);
        }
      })
      .catch(error => console.error('Error fetching data:', error));
  };

  return (
    <div>
      <h2>Search&Check:</h2>
      <div>
        <input type="text" value={searchValue} onChange={handleSearchInputChange} />
        <button onClick={handleSearch}>Search</button>
      </div>
      <div>
        <label>
          <input type="radio" name="category" value="accID" checked={selectedCategory === 'accID'} onChange={() => handleRadioChange('accID')} />
          accID
        </label>
        <label>
          <input type="radio" name="category" value="nameEN" checked={selectedCategory === 'nameEN'} onChange={() => handleRadioChange('nameEN')} />
          English
        </label>
        <label>
          <input type="radio" name="category" value="nameAR" checked={selectedCategory === 'nameAR'} onChange={() => handleRadioChange('nameAR')} />
          Arabic
        </label>
        <label>
          <input type="radio" name="category" value="nameC" checked={selectedCategory === 'nameC'} onChange={() => handleRadioChange('nameC')} />
          Code
        </label>
        
      </div>
      {data.map((row, index) => (
        
        <div key={index} style={{ marginBottom: '20px' }}>
          <h3>{`Row ${index + 1}`}</h3>
          <table>
            <tbody>
              {row === 'No result' ? (
                <tr>
                  <td>No result</td>
                </tr>
              ) : (
                Object.entries(row).map(([key, value]) => (
                  <tr key={key}>
                    <th>{key}</th>
                    <td>{value}</td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      ))}
      {data.map((row, index) => (
      <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Account ID</TableCell>
            <TableCell align="right">Name(EN)</TableCell>
            <TableCell align="right">Name(AR)&nbsp;(g)</TableCell>
            <TableCell align="right">Name(C)&nbsp;(g)</TableCell>
            <TableCell align="right">Services&nbsp;(g)</TableCell>
            <TableCell align="right">Contract Status&nbsp;(g)</TableCell>
            <TableCell align="right">Expiry Date&nbsp;(g)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {Object.entries(row).map(([key, value]) => (
            <TableRow
              key={key}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >

              <TableCell align="right">{value}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>))}
    </div>
  );
};

export default Search;
